import React from "react";
import {Item} from "../../slices/counterSlice";

interface AllItemsProps {
    itemList: Item[];
}

const AllItems = ({ itemList }: AllItemsProps) => {
    return (
        <ul>
            {itemList.map((item) => {
                console.log(item)
                return (
                    <li key={item.id}>
                        {item.task}
                    </li>
                )
            })}
        </ul>
    )
}
export default AllItems
